import React, {useState, useCallback} from "react";
import Header from "../src/components/generic/Header";
import PageSection from "../src/components/PageSection";
import GenericTextInput from "../src/components/generic/GenericTextInput";
import {connect} from 'react-redux';
// import { withRouter } from 'next/router'

import Router from 'next/router'
// const router = Router

class ContactUs extends React.Component{
  constructor(props){
    super(props)
    const {categories:{isSuccess}, ...res}  = this.props;
    console.log(res,'llll');

    if(!isSuccess){
      Router.push('/')
    }
  }
  render(){
    return(
      <div className="contact-us">
      <Header route = {this.props.router.route} />
      <PageSection />
      <div className="form-wrapper">
        <div>
          <h2>Please note:</h2>
          <span>
            Please don’t contact us for theme support related questions as they
            will be ignored. Use our <a href="#">Support Forum</a> .
          </span>
          <GenericTextInput />
          <GenericTextInput />
          <GenericTextInput />
          <GenericTextInput />
          <GenericTextInput />
          <div className="text-area-container">
            <span>
              Your Message (Support requests won't be answered. For that use our{" "}
              <a href="#">support forum</a>.)
            </span>
            <br />
            <textarea cols="40" rows="10" className="message-text-area" />
            <div className='attach-file'>
              Attach file (translation files, screenshot, etc)
            </div>
            <input className='file-type' type='file' /><br></br>
            <input className='submit-btn' type='submit' value='Send'/>
          </div>
        </div>
        <div></div>
      </div>
    </div>
    )
  }
}

const mapStateToProps = (state)=>({
  categories:state.categories.categoryData
})

export default  connect (mapStateToProps)(ContactUs);


